import React from "react";
import { useEffect } from "react";

const StarWarsApi = () => {
    useEffect(async () => {

        let random = 'https://swapi.dev/api/films/1/'
        let info = await (await fetch(random)).json();
   
    return (
        <div>
            <>{console.log(info)}</>
        </div>
    ) 
})
}

export default StarWarsApi
